import React from 'react';
import './Warehouse.css';

import Sidebar from '../Sidebar/Sidebar';
import Main from '../Main/Main';

function Warehouse() {
  return (
    <div className="Warehouse">
      <Sidebar/>
      <Main/>
    </div>
  );
}

export default Warehouse;
